import React from 'react';
import ReactDOM from 'react-dom';
import PicCarousel from './picCarousel.js';

class Coursel extends React.Component{
  constructor(props){
    super(props);
  }
render(){
  return(
   <div className="card rounded-lg border-1 shadow-lg">
     <img className="card-img-top rounded-circle" src={this.props.item.picName} alt="ImgPath" />
     <div className="card-body">
      <p className="card-title font-weight-bolder font-italic">{this.props.item.picTitle}</p>
      <p className="card-text"> {this.props.item.picText}</p>
    </div>
  </div>
  );
 }
}

export default Coursel
